#[derive(Derivative)]
#[derivative(Debug="transparent")]
pub struct Wrapping(pub T);

pub struct Wrapping(pub T);

impl fmt::Debug for Wrapping {
    fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result {
        self.0.fmt(f)
    }
}




